import React from 'react';

function LightingDesign() {
  return (
    <section className="py-20">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-8">Lighting Design</h2>
        <img src="https://images.unsplash.com/photo-1540569014015-19a7be504e3a" alt="Lighting" className="w-full h-96 object-cover rounded-lg mb-8" />
        <p className="text-lg text-center max-w-2xl mx-auto">
          Customized lighting solutions for every space to enhance functionality and create ambiance.
        </p>
      </div>
    </section>
  );
}

export default LightingDesign;
